import React from 'react'
import styled from 'styled-components'

const Container = styled.div``;
const Product = () => {
  return (
    <Container>
        <Navbar/>
        <Announcement/>

        
        <Newsletter/>
        <Footer/>
    </Container>
  )
}

export default Product
